import React, { Component } from "react";
import "./App.css";
import "./About.css";

class About extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="About">
      <div className="para">
        <h1>Tirza is</h1>
        </div>
      </div>
    );
  }
}

export default About;
